import Fruit from "./Fruit";

const array = ["Apple", "Banana", "Orange"];
function App() {
  return (
    <>
      <ul>
        {array.map((frt, ind) => {
          return <Fruit k={ind} name={frt} />;
        })}
      </ul>
    </>
  );
}

export default App;
